        const expenseData = {
            ...enteredExpenseData,
            id: Math.random().toString()
        }
        props.onSendNewExpense(expenseData)

    }
    const addNewExpenses = <h1>Nada</h1>
    if (bool === true) {
        const addNewExpenses = <button>Add new expenses</button>
    }


    const expensesForm = 
    <ExpenseForm onSaveExpenseData={saveExpenseDataHandler} />

    return (
        <div className="new-expense">
            {addNewExpenses}
            {expensesForm}
        </div>
    )
}

export default NewExpense;
